import styled from 'styled-components';
import { breakpoints } from '../../../styles/theme/theme';

export const Container = styled.nav`
  height: 72px;
  width: 100vw;
  background-color: red;
  display: flex;
  padding: 12px 32px;

  @media screen and (min-width: ${breakpoints.sm}) {
    background-color: yellow;
  }
`;
